import React from "react";
import { Problems, ProblemBg, ProblemImg } from "./ProblemElements";
import img from "../../images/failure.jpg";
import img2 from "../../images/failure2.jpg";

function Problem() {
  return (
    <>
      <Problems id="problem">
        <ProblemBg>
          <ProblemImg src={img2} />
        </ProblemBg>
      </Problems>
    </>
  );
}

export default Problem;
